// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import HomePage from './pages/HomePage';
import CategoryPage from './pages/CategoryPage';
import GazeTracker from './components/GazeTracker'; // นำเข้าคอมโพเนนต์ GazeTracker
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="app-container">
        <Sidebar />
        <div className="main-content">
          <Routes>
            <Route path="/" element={<><HomePage /><GazeTracker /></>} />
            <Route path="/category/:id" element={<><CategoryPage /><GazeTracker /></>} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
